      crossorigin="anonymous"
    ></script>
  </head>
  <body>
    <div class="container mt-3 ">
        <h3 class="text-primary">
            Popular Course
          </h3>
    </div>
   
    <div class="container">
        <div class="row">
          <div class="col">
            <div class="container mt-4">
                <div class="card" style="width: 19rem">
                <img src="https://th.bing.com/th/id/OIP.qCBmQTUqT2qFk1Mm7LrVpAHaDK?w=310&h=149&c=7&r=0&o=5&dpr=1.5&pid=1.7" alt="">
                  <div class="card-body">
                    <h5 class="card-title text-info">CAT</h5>
                    <p class="card-text text-danger">
                     Course Fee ₹999
                    </p>
                    <a href="payment.html" class="btn btn-primary">Get The Course</a>
                  </div>
                </div>
              </div>
          </div>  
      
          <div class="col">
            <div class="container mt-4">
                <div class="card" style="width: 18rem">
                <img src="https://th.bing.com/th/id/OIP.33ulZpKAR9h0IODyu4m3VQHaD3?w=335&h=180&c=7&r=0&o=5&dpr=1.5&pid=1.7" alt="">
                  <div class="card-body">
                    <h5 class="card-title text-warning">GMAT</h5>

                    <p class="card-text text-danger">
                     Course Fee ₹899
                    </p>
                    <a href="payment.html" class="btn btn-primary">Get The Course</a>
                  </div>
                </div>
              </div>
          </div>

          <div class="col">
            <div class="container mt-4">
                <div class="card" style="width: 18rem">
                <img src="https://th.bing.com/th/id/OIP.j5w4cpHaHnxmWjz30ZkPQAHaEK?w=322&h=181&c=7&r=0&o=5&dpr=1.5&pid=1.7" alt="">
                  <div class="card-body">
                    <h5 class="card-title">NDA</h5>
                    <p class="card-text text-danger">
                     Course Fee ₹999
                    </p>
                    <a href="payment.html" class="btn btn-primary">Get The Course</a>
                  </div>
                </div>
          </div>
        </div>
      </div>
       
      <div class="container">
        <div class="row">
          <div class="col">
            <div class="container mt-4">
                <div class="card" style="width: 18rem">
                <img src="data:image/jpeg;base64," alt="">
                  <div class="card-body">
                    <h5 class="card-title text-info">Jee Mains</h5>
                    <p class="card-text text-danger">
                     Course Fee ₹100
                    </p>
                    <a href="payment.html" class="btn btn-primary">Get The Course</a>
                  </div>
                </div>
              </div>
          </div>  
      
          <div class="col">
            <div class="container mt-4">
                <div class="card" style="width: 18rem">
                <img src="https://th.bing.com/th/id/OIP.bBtTU4HMCcEeapWhq9Py4AHaDz?w=262&h=160&c=7&r=0&o=5&dpr=1.5&pid=1.7" alt="">
                  <div class="card-body">
                    <h5 class="card-title text-warning">Bank Exams</h5>
                      <p class="card-text text-danger">
                     Course Fee ₹100
                    </p>
                    <a href="payment.html" class="btn btn-primary">Get The Course</a>
                  </div>
                </div>
              </div>
          </div>

          <div class="col">
            <div class="container mt-4">
                <div class="card" style="width: 18rem">
                <img src="data:image/jpeg;base64," alt="">
                  <div class="card-body">
                    <h5 class="card-title text-info">NEET</h5>
                    <p class="card-text text-danger">
                     Course Fee ₹100
                    </p>
                    <a href="payment.html" class="btn btn-primary">Get The Course</a>
                  </div>
                </div>
          </div>
        </div>
      </div>
       
     
  </body>
</html>













